import ReactDOM from 'react-dom/client';
import App from './App';
import './i18n';
import './style.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App 
      mainTitle="Nieve's Ice Cream Shop"
    />
  </React.StrictMode>
);
